import React from "react";
import { useNavigate } from "react-router-dom";

const HomePage = () => {
  const navigate = useNavigate();

  const handleClick = () => {
    navigate("/login");
  };

  return (
    <div>
      <h1>Home Page</h1>
      <button onClick={handleClick}>Go to Login Page</button>
    </div>
  );
};

export default HomePage;
